import React from "react";
import ListItem from "./list-item";

const TodoList = () => {

    const items = ['покушать','выспаться'];
    return (
        <ul>
            <li>{items[0] }</li>
            <li>{items[1] }</li>
            <li><ListItem label="пить кофе"/></li>
            <li><ListItem label="Учиться"/></li>
        </ul>
    );
}

export default TodoList;
